/**********************************
 * [CONTROLLER] SEARCH
 *********************************/
app.controller('SearchCtrl', function(Firebase, Auth, User, $scope, $firebaseArray, $ionicPopup, $cordovaCamera, PhotoSrv) {

  $scope.bieres = null;
  $scope.types = [];
  $scope.pays = [];
  $scope.couleurs = [];
  $scope.volumes = [];
  $scope.listlength = 15;

  /**********************************
   * [FIREBASE] GET TYPE
   *********************************/

  var refType = firebase.database().ref('type');
  $scope.types = $firebaseArray(refType);

  /**********************************
   * [FIREBASE] GET PAYS
   *********************************/

  var refPays = firebase.database().ref('pays');
  $scope.pays = $firebaseArray(refPays);

  /**********************************
   * [FIREBASE] GET COULEUR
   *********************************/

  var refCouleur = firebase.database().ref('couleur');
  $scope.couleurs = $firebaseArray(refCouleur);

  /**********************************
   * [FIREBASE] GET VOLUME
   *********************************/

  var refVolume = firebase.database().ref('volume');
  $scope.volumes = $firebaseArray(refVolume);

  /**********************************
   * [FIREBASE] GET BIERE
   *********************************/

  var refBiere = firebase.database().ref('biere');
  $scope.bieres = $firebaseArray(refBiere);

  /**********************************
   * SCROLLING
   *********************************/
  $scope.loadMore = function(){
    if (!$scope.bieres){
      $scope.$broadcast('scroll.infiniteScrollComplete');
      return;
    }
    if ($scope.listlength < $scope.bieres.length) {
      $scope.listlength += 5;
    }
    $scope.$broadcast('scroll.infiniteScrollComplete');
  }
    
  $scope.$watch('query', function() {
    $scope.listlength = 15;
  });

  /**********************************
   * [DISPLAY] PAGE
   *********************************/

  $scope.page = 1;

  $scope.setPage = function(choice) {
    $scope.page = choice;
  }

    /**********************************
   * [IONIC] ALERT
   *********************************/

  $scope.showAlert = function(titre,text) {
    var alertPopup = $ionicPopup.alert({
      title: titre,
      template: text
    });

    alertPopup.then(function(res) {
      console.log('Alert show');
    });
  };

  /**********************************
   * PICTURE
   *********************************/

  $scope.takePicture = function() {
    var options = { 
      quality : 75, 
      destinationType : Camera.DestinationType.DATA_URL, 
      sourceType : Camera.PictureSourceType.CAMERA, 
      allowEdit : true,
      encodingType: Camera.EncodingType.JPEG,
      targetWidth: 400,
      targetHeight: 400,
      popoverOptions: CameraPopoverOptions,
      saveToPhotoAlbum: false
    };
  
    $cordovaCamera.getPicture(options).then(function(imageData) {
      $scope.imgURI = "data:image/jpeg;base64," + imageData;
    }, function(err) {
      console.log("Error");
    });
  }

  $scope.sendImageBase = function() {
    // $scope.imgURI = "data:image/jpeg;base64,";
    if(!angular.isDefined($scope.imgURI)) {
      $scope.showAlert("Photo","Prenez une photo avant ...");
    } else {
      $scope.loading = true;
      PhotoSrv.sendImage($scope.imgURI).then(function(response) {
        remoteDataComparison(response);
        $scope.loading = false;
      });
    }
  }

  function remoteDataComparison(rep) {
    $scope.response = rep;

    if(rep["error"] == "false") {
      var tmp = [];
      for(var i=0;i<rep["similar"].length;i++) {
        var id = rep["similar"][i];
        firebase.database().ref('biere/' + id).on('value', function(snapshot) {
          tmp.push({
            id:id,
            content: snapshot.val()
          });
          if(tmp.length == rep["similar"].length) {
            $scope.$apply(function () {
              $scope.infoComparison = tmp;
            });
          }
        });
      }
    }
  }
});